import { FiSearch, FiPlus } from 'react-icons/fi';

function NaviBar() {
  return (
    <>
      <nav>
        <button className="search-btn icon-btn">
          <FiSearch />
        </button>
        <button className="post-btn icon-btn">
          <FiPlus />
        </button>
        <button className="search-btn icon-btn">
          <FiSearch />
        </button>
      </nav>
    </>
  );
}

export default NaviBar;
